INSERT INTO model VALUES (1,'model 1','test model 1','head	1.1;\naccess;\nsymbols;\nlocks; strict;\ncomment	@# @;\n\n\n1.1\ndate	2004.04.05.13.22.41;	author vicini;	state Exp;\nbranches;\nnext	;\n\n\ndesc\n@@\n\n\n1.1\nlog\n@@\ntext\n@$PROBLEM THEOPHYLLINE POPULATION DATA\n$DATA THEO\n$INPUT ID AMT=DOSE TIME DV=CP WT\n$PRED \n;THETA(1)=MEAN ABSORPTION RATE CONSTANT (1/HR)\n;THETA(2)=MEAN ELIMINATION RATE CONSTANT (1/HR)\n;THETA(3)=SLOPE OF CLEARANCE VS WEIGHT RELATIONSHIP (LITERS/HR/KG)\n;DOSE=WT-ADJUSTED DOSE (MG/KG)\n;DS=NON-WT-ADJUSTED DOSE (MG)\n   IF (DOSE.NE.0) THEN\n      DS=DOSE*WT\n      W=WT\n   ENDIF\n   KA=THETA(1)+ETA(1)\n   KE=THETA(2)+ETA(2)\n   CL=THETA(3)*W+ETA(3)\n   D=EXP(-KE*TIME)-EXP(-KA*TIME)\n   E=CL*(KA-KE)\n   F=DS*KE*KA/E*D\n   Y=F+EPS(1)\n$THETA \n(.1,3,5)\n(.008,.08,.5)\n(.004,.04,.9)\n$OMEGA BLOCK(3) 6 .005 .0002 .3 .006 .4\n$SIGMA DIAGONAL(1) .4\n$ESTIMATION METHOD=0 SIGDIGITS=3 MAXEVALS=450 PRINT=5\n$COVARIANCE\n$TABLE ID DOSE WT TIME\n$SCATTERPLOT RES WRES VS TIME BY ID FROM 1 TO 900 NOABS0 NOORD0\n@\n',3);
INSERT INTO model VALUES (2,'model 2','test model 2','head	1.1;\naccess;\nsymbols;\nlocks; strict;\ncomment	@# @;\n\n\n1.1\ndate	2004.04.05.13.26.48;	author vicini;	state Exp;\nbranches;\nnext	;\n\n\ndesc\n@@\n\n\n1.1\nlog\n@@\ntext\n@$PROBLEM THEOPHYLLINE POPULATION DATA\n$DATA THEO\n$INPUT ID AMT=DOSE TIME DV=CP WT\n$PRED \n;THETA(1)=MEAN ABSORPTION RATE CONSTANT (1/HR)\n;THETA(2)=MEAN ELIMINATION RATE CONSTANT (1/HR)\n;THETA(3)=SLOPE OF CLEARANCE VS WEIGHT RELATIONSHIP (LITERS/HR/KG)\n;DOSE=WT-ADJUSTED DOSE (MG/KG)\n;DS=NON-WT-ADJUSTED DOSE (MG)\n   IF (DOSE.NE.0) THEN\n      DS=DOSE*WT\n      W=WT\n   ENDIF\n   KA=THETA(1)+ETA(1)\n   KE=THETA(2)+ETA(2)\n   CL=THETA(3)*W+ETA(3)\n   D=EXP(-KE*TIME)-EXP(-KA*TIME)\n   E=CL*(KA-KE)\n   F=DS*KE*KA/E*D\n   Y=F+EPS(1)\n$THETA \n(.1,3,5)\n(.008,.08,.5)\n(.004,.04,.9)\n$OMEGA BLOCK(3) 6 .005 .0002 .3 .006 .4\n$SIGMA DIAGONAL(1) .4\n$ESTIMATION METHOD=0 SIGDIGITS=3 MAXEVALS=450 PRINT=5\n$COVARIANCE\n$TABLE ID DOSE WT TIME\n$SCATTERPLOT RES WRES VS TIME BY ID FROM 1 TO 900 NOABS0 NOORD0\n@\n',3);
INSERT INTO model VALUES (3,'GAUSS3_1','http://www.itl.nist.gov/div898/strd/nls/data/gauss1.shtml','head	1.2;\naccess;\nsymbols;\nlocks; strict;\ncomment	@# @;\n\n\n1.2\ndate	2004.04.05.14.12.52;	author vicini;	state Exp;\nbranches;\nnext	1.1;\n\n1.1\ndate	2004.04.05.14.01.51;	author vicini;	state Exp;\nbranches;\nnext	;\n\n\ndesc\n@@\n\n\n1.2\nlog\n@Gauss3_2 New initial estimates\n@\ntext\n@$PROBLEM GAUSS3_2\n$DATA gauss3_1.txt\n$INPUT TIME DV\n$PRED \nb1 = THETA(1)\nb2 = THETA(2)\nb3 = THETA(3)\nb4 = THETA(4)\nb5 = THETA(5)\nb6 = THETA(6)\nb7 = THETA(7)\nb8 = THETA(8)\nx = TIME\nF=b1*EXP(-b2*x)+b3*EXP(-((x-b4)**2)/(b5**2))+b6*EXP(-((x-b7)**2)/(b8**2))\nY = F + ETA(1)\n$THETA \n(9.6,96,960)\n(0.00096,0.0096,0.096)\n(8,80,800)\n(11,110,1100)\n(2.5,25,250)\n(7.4,74,740)\n(13.9,139,1390)\n(2.5,25,250)\n$OMEGA DIAGONAL(1) 1\n$ESTIMATION METHOD=0 SIGDIGITS=3 MAXEVALS=450 PRINT=5\n$COVARIANCE\n$TABLE TIME F FILE=gauss3_2.out\n@\n\n\n1.1\nlog\n@@\ntext\n@d1 1\na1 1\n$PROBLEM GAUSS3_1\nd17 8\na24 8\n(9.49,94.9,949)\n(0.0009,0.009,0.09)\n(9.01,90.1,901)\n(11.3,113,1130)\n(2,20,200)\n(7.38,73.8,738)\n(14,140,1400)\n(2,20,200)\nd28 1\na28 1\n$TABLE TIME F FILE=GAUSS3_1.out\n@\n',3);
INSERT INTO model VALUES (4,'HAHN1','http://www.itl.nist.gov/div898/strd/nls/data/hahn1.shtml','head	1.2;\naccess;\nsymbols;\nlocks; strict;\ncomment	@# @;\n\n\n1.2\ndate	2004.04.05.14.26.49;	author vicini;	state Exp;\nbranches;\nnext	1.1;\n\n1.1\ndate	2004.04.05.14.20.59;	author vicini;	state Exp;\nbranches;\nnext	;\n\n\ndesc\n@@\n\n\n1.2\nlog\n@hahn1_2 new initial estimates\n@\ntext\n@$PROBLEM HAHN1_2\n$DATA hahn1.txt\n$INPUT TIME DV\n$PRED \nb1 = THETA(1)\nb2 = THETA(2)\nb3 = THETA(3)\nb4 = THETA(4)\nb5 = THETA(5)\nb6 = THETA(6)\nb7 = THETA(7)\nx = TIME\nF = (b1+b2*x+b3*x**2+b4*x**3) /(1+b5*x+b6*x^2+b7*x**3)\nY = F + ETA(1)\n$THETA \n(0.1,1,10)\n(-1,-0.1,-0.01)\n(0.0005,0.005,0.05)\n(-0.00001,-0.000001,-0.0000001)\n(-0.05,-0.005,-0.0005)\n(0.00001,0.0001,0.001)\n(-0.000001,-0.0000001,-0.00000001)\n$OMEGA DIAGONAL(1) 1\n$ESTIMATION METHOD=0 SIGDIGITS=3 MAXEVALS=450 PRINT=5\n$COVARIANCE\n$TABLE TIME F FILE=hahn_2.out\n@\n\n\n1.1\nlog\n@@\ntext\n@d1 1\na1 1\n$PROBLEM HAHN1_1\nd16 3\na18 6\n(1,10,100)\n(-10,-1,-0.1)\n(0.003,0.05,0.5)\n(-0.00010000,-0.00001,-0.000001)\n(-0.5,-0.05,-0.005)\n(0.0001,0.001,0.01)\nd20 3\nd26 1\na26 1\n$TABLE TIME F FILE=HAHN1_1.OUT\n@\n',3);
INSERT INTO model VALUES (5,'KIRBY2','http://www.itl.nist.gov/div898/strd/nls/data/kirby2.shtml','head	1.2;\naccess;\nsymbols;\nlocks; strict;\ncomment	@# @;\n\n\n1.2\ndate	2004.04.08.15.53.14;	author vicini;	state Exp;\nbranches;\nnext	1.1;\n\n1.1\ndate	2004.04.08.15.48.57;	author vicini;	state Exp;\nbranches;\nnext	;\n\n\ndesc\n@@\n\n\n1.2\nlog\n@kirby2_2\n@\ntext\n@$PROBLEM KIRBY2_2\n$DATA kirby2.txt\n$INPUT TIME DV\n$PRED \nb1 = THETA(1)\nb2 = THETA(2)\nb3 = THETA(3)\nb4 = THETA(4)\nb5 = THETA(5)\nx = TIME\nF=(b1 + b2*x + b3*x^2) /(1 + b4*x + b5*x**2)\nY = F + ETA(1)\n$THETA \n(0.15,1.5,15)\n(-1.5,-0.15,-0.015)\n(0.00025,0.0025,0.025)\n(-0.015,-0.0015,-0.00015)\n(0.000002,0.00002,0.0002)\n$OMEGA DIAGONAL(1) 1\n$ESTIMATION METHOD=0 SIGDIGITS=3 MAXEVALS=450 PRINT=5\n$COVARIANCE\n$TABLE TIME FILE=kirby2_2.out\n@\n\n\n1.1\nlog\n@@\ntext\n@d1 1\na1 1\n$PROBLEM KIRBY2_1\nd14 5\na18 5\n(0.2,2,20)\n(-1,-0.1,-0.01)\n(0.0003,0.003,0.03)\n(-0.01,-0.001,-0.0001)\n(0.000001,0.00001,0.0001)\nd22 1\na22 1\n$TABLE TIME FILE=kirby2_1.out\n@\n',3);

